  name: string
}

type DNameProps = {
  name: string
}

type Human = {
  name: string
  age: number
  location: string,
  music: string[],
  isCool: boolean
}

const DisplayName = ({ name }: DNameProps) => {
  return <h1>{ name }</h1>
}

function App() {
  return (
    <div className="App">
      <DisplayName name={"Bryan"} />
    </div>
  );
}

export default App;
